import { Link } from "react-router-dom";

export default function Navbar() {
  return (
    <nav style={{
      display: "flex",
      justifyContent: "space-between",
      alignItems: "center",
      padding: "1rem 2rem",
      backgroundColor: "#f7f7f7"
    }}>
      <div style={{ fontSize: "2rem" }}>Carol Li Zhang</div>
      <div>
        <Link to="/projects" style={{ fontSize: "2rem", marginLeft: "2rem", textDecoration: "none", color: "black" }}>
          Projects
        </Link>
        <Link to="/about" style={{ fontSize: "2rem", marginLeft: "2rem", textDecoration: "none", color: "black" }}>
          About
        </Link>
      </div>
    </nav>
  );
}
